    const { userId } = useParams();

    const [ name, setname ] = useState();
    const [ gender, setGender ] = useState();
    const [ dob, setDob ] = useState();
    const [ phoneNo, setPhoneNo ] = useState();
    const [ address, setAddress ] = useState();
    const [ email, setEmail ] = useState();

    const changeName = (event) => {
        setname
    }

    const changeGender = (event) => {
        setGender(event.target.value);
        console.log(gender);
    }

  return (
    <section id='personaldetails'>
        <form id='personaldetailsform' >
            <label>
                Name : <input type='text' value={name} />
            </label>
            <label>
                Gender : <input type='radio' name='gender' value='M' />Male
                <input type='radio' name='gender' value='F' />Felmale
            </label>
            <label>
                Phone Number : <input type='number' min={1000000000} max={9999999999} value={phoneNo} />
            </label>
            <label>
                Address : <textarea type='text' value={address} />
            </label>
            <label>
                Email : <input type='email' value={email} />
            </label>
        </form>
    </section>
  )
}
